INSERT INTO `form_response` VALUES (1,1,7,'University of Toronto'),(2,3,7,'University of Toronto - Downtown Toronto (St. George) Campus'),(3,19,7,'27 King\'s College Circle'),(4,18,7,'Toronto'),(5,17,7,'M5S1A1'),(6,16,7,'Academic Accommodations'),(7,15,7,'Academic Accommodations'),(8,12,7,'Ontario.'),(9,14,7,'Accessibility Services provides academic accommodations in  collaboration with students, staff and faculty to support students with documented disabilities in equal opportunities to achieve academic and co-curricular success.\nServices include: adaptive technology, learning strategies, support groups, problem solving, resource/referral and assessment.  Academic Accommodations may include extra time for tests and exams and negotiated extensions.'),(10,13,7,'On the Accessibility Services website, select a Registration Package that best describes your disability. Contact Accessibility Services to schedule an intake appointment. During your intake interview, you will have the opportunity to discuss any additional issues or concerns. If you do not have documentation of your disability, you can book an appointment for consultation.  If you have a learning disability or attention deficit hyperactivity disorder (ADHD) you may fill out the package without documentation. See website for more information about Accessibility Services.'),(11,9,7,'Based on Client Need'),(12,8,7,'416'),(13,7,7,'9788060'),(14,5,7,'accessibility.services@utoronto.ca'),(15,4,7,'215 Huron Street, 9th floor.'),(16,11,7,'N'),(17,1,8,'University of Toronto'),(18,3,8,'University of Toronto - Downtown Toronto (St. George) Campus'),(19,19,8,'27 King\'s College Circle'),(20,18,8,'Toronto'),(21,17,8,'M5S1A1'),(22,16,8,'Assault Counselling & Education'),(23,15,8,'Counselling and Treatment'),(24,12,8,'Ontario.'),(25,14,8,'We provide assistance to students who have experienced sexual assault and dating or partner violence.'),(26,13,8,'You can call directly to make an appointment for a consultation. In our first meeting we will discuss your situation and needs, and plan how to best assist you.  Please leave your name and number, and whether it is safe to leave a message for you. Calls will generally be returned within 24 hours, except on evenings and weekends.'),(27,10,8,'There will be a charge of $45.00 for each missed appointment if 24 hours\' notice of cancellation is not given.'),(28,9,8,'Based on Client Need'),(29,8,8,'416'),(30,7,8,'9780174'),(31,4,8,'Koffler Student Service Centre, Main floor.'),(32,2,8,'111'),(33,11,8,'Y'),(34,1,9,'University of Toronto'),(35,3,9,'University of Toronto - Downtown Toronto (St. George) Campus'),(36,19,9,'27 King\'s College Circle'),(37,18,9,'Toronto'),(38,17,9,'M5S1A1'),(39,16,9,'Counseline'),(40,15,9,'Community Treatment'),(41,12,9,'Ontario.'),(42,14,9,'Graduate intern students of the Factor-Inwentash Faculty of Social Work, University of Toronto, provide both cyber counselling and face-to face counselling. The students are supervised by a registered social worker, who has many years of experience counselling University of Toronto students.\nCyber Counselling and Counselling Services for: anxiety, depression, eating disorders, family problems, general issues, school issues, interpersonal difficulties, sexual abuse, sexual issues, sexual orientation concerns and, substance / alcohol / drug use.'),(43,13,9,'Program is restricted to Faculty of Arts and Science Colleges undergraduates. Students can access more information by calling.'),(44,9,9,'Based on Client Need'),(45,8,9,'416'),(46,7,9,'9465117'),(47,4,9,'University College, East Wing, 2nd floor.'),(48,2,9,'259a,b,c'),(49,11,9,'N'),(50,1,10,'University of Toronto'),(51,3,10,'University of Toronto - Downtown Toronto (St. George) Campus'),(52,19,10,'27 King\'s College Circle'),(53,18,10,'Toronto'),(54,17,10,'M5S1A1'),(55,16,10,'Counseline'),(56,15,10,'Counselling and Treatment'),(57,12,10,'Ontario.'),(58,14,10,'Graduate intern students of the Factor-Inwentash Faculty of Social Work, University of Toronto, provide both cyber counselling and face-to face counselling. The students are supervised by a registered social worker, who has many years of experience counselling University of Toronto students.\nCyber Counselling and Counselling Services for: anxiety, depression, eating disorders, family problems, general issues, school issues, interpersonal difficulties, sexual abuse, sexual issues, sexual orientation concerns and, substance / alcohol / drug use.'),(59,13,10,'Program is restricted to Faculty of Arts and Science Colleges undergraduates. Students can access more information by calling.'),(60,9,10,'Based on Client Need'),(61,8,10,'416'),(62,7,10,'9465117'),(63,4,10,'University College, East Wing, 2nd floor.'),(64,2,10,'259a,b,c'),(65,11,10,'N'),(66,1,11,'University of Toronto'),(67,3,11,'University of Toronto - Downtown Toronto (St. George) Campus'),(68,19,11,'27 King\'s College Circle'),(69,18,11,'Toronto'),(70,17,11,'M5S1A1'),(71,16,11,'Counselling and Psychological Services (CAPS)'),(72,15,11,'Counselling and Treatment'),(73,12,11,'Ontario.'),(74,14,11,'Counselling and Psychological Services (CAPS) offers students short-term individual counselling, psychotherapy, workshops, and psychiatric medication services. The interprofessional team offers assessment, treatment and referrals for a wide range of emotional and psychological problems. Many workshops available.'),(75,13,11,'In order to ensure privacy, CAPS staff and service do not use e-mail to communicate with students. Students can call or come to the service in person if they have any questions or wish to book/reschedule an appointment.  Students will be scheduled for a 20-minute phone evaluation.  We will require your student number and health card number (OHIP or other provincial insurance, or UHIP) to book the appointment.  Personal counselling and workshops are available following the phone evaluation.'),(76,9,11,'Based on Client Need'),(77,8,11,'416'),(78,7,11,'9788070'),(79,4,11,'Koffler Student Service Centre, first floor.'),(80,11,11,'N'),(81,1,12,'University of Toronto'),(82,3,12,'University of Toronto - Downtown Toronto (St. George) Campus'),(83,19,12,'27 King\'s College Circle'),(84,18,12,'Toronto'),(85,17,12,'M5S1A1'),(86,16,12,'First Nations House - Elder Counselling'),(87,15,12,'Counselling and Treatment'),(88,12,12,'Ontario.'),(89,14,12,'First Nations House provides a number of culturally supportive student services and programs to Aboriginal students and the general university community. Elders and Traditional Teachers are vital to the Aboriginal community.  At First Nations House they provide support and guidance to students, staff and faculty.   Support can be offered through individual sessions or through group teachings. Many of our speakers and events are open to the community.'),(90,13,12,'Students can make an appointment in person, by telephone or by email.'),(91,9,12,'Based on Client Need'),(92,8,12,'416'),(93,7,12,'9788227'),(94,5,12,'fnh.info@utoronto.ca'),(95,4,12,'Borden Building North, Third floor.'),(96,11,12,'N'),(97,1,13,'University of Toronto'),(98,3,13,'University of Toronto - Downtown Toronto (St. George) Campus'),(99,19,13,'27 King\'s College Circle'),(100,18,13,'Toronto'),(101,17,13,'M5S1A1'),(102,16,13,'Health Service'),(103,15,13,'Health Centre (Mental Health)'),(104,12,13,'Ontario.'),(105,14,13,'Health Services offers University of Toronto students the same services as a family doctor\'s office, and more. We provide confidential, student-centered health care, including comprehensive medical care, travel medicine and education, immunization, and referrals for specialized treatment. The multidisciplinary health team includes family physicians, registered nurses, a dietician, and support staff. We are here to help support you in achieving your personal and academic goals.'),(106,13,13,'Book an appointment in person or over the telephone. Bring Student Identification and Health Card (OHIP, UHIP or Out of Province).'),(107,10,13,'Fees apply to missed appointments.  See website for  applicable fees.'),(108,9,13,'Based on Client Need'),(109,8,13,'416'),(110,7,13,'9788030'),(111,4,13,'Koffler Student Service Building, Second floor.  (Access from St. George Street entrance)'),(112,11,13,'Y'),(113,1,14,'University of Toronto'),(114,3,14,'University of Toronto - Downtown Toronto (St. George) Campus'),(115,19,14,'27 King\'s College Circle'),(116,18,14,'Toronto'),(117,17,14,'M5S1A1'),(118,16,14,'Healthy U Crew'),(119,15,14,'Health Promotion and Education'),(120,12,14,'Ontario.'),(121,14,14,'The Healthy U Crew is a student-led team at the University of Toronto St. George dedicated to creating a healthier campus for all students. We are committed to assisting students to make healthier choices that can help them achieve their academic and personal goals. But creating a healthy campus is about more than just lifestyle choices, it\'s also about creating systems and structures that encourage and support students to make healthy choices. Through education, advocacy and collaboration with campus and community partners, the Health U Crew works to create a healthy campus that is sustainable and inclusive.'),(122,13,14,'For more information see the Healthy U Crew on facebook and twitter.'),(123,9,14,'Based on Client Need'),(124,8,14,'416'),(125,7,14,'9788044'),(126,5,14,'healthyucrew@gmail.com'),(127,4,14,'Koffler Student Services Centre.'),(128,2,14,'231'),(129,11,14,'N'),(130,1,15,'University of Toronto'),(131,3,15,'University of Toronto - Downtown Toronto (St. George) Campus'),(132,19,15,'27 King\'s College Circle'),(133,18,15,'Toronto'),(134,17,15,'M5S1A1'),(135,16,15,'Know the Score 2'),(136,15,15,'Problem Gambling Awareness'),(137,12,15,'Ontario.'),(138,14,15,'An interactive problem gambling awareness program for college and university students.'),(139,13,15,'Any student enrolled at any college or university across Ontario can answer the five-question quiz online at kts2.ca or mj2.ca.  They can also visit the display located on 29 college and university campuses in the fall 2013 and winter 2014 semester.  Locations of the displays will be available on the English and French websites.  \nStudent staff can apply online via the two websites to help deliver the kts2 or mj2 program at the 29 campuses where there will be an on-campus display.  Once their application is received, they will be contacted via phone for an interview and if successful will participate in a paid training session at each of the campuses that the display will be set up on.  Training is mandatory.'),(140,9,15,'3 Days'),(141,5,15,'knowthescore@rgco.org or kts2@rgco.org'),(142,11,15,'N'),(143,1,16,'University of Toronto'),(144,3,16,'University of Toronto - Downtown Toronto (St. George) Campus'),(145,19,16,'27 King\'s College Circle'),(146,18,16,'Toronto'),(147,17,16,'M5S1A1'),(148,16,16,'Leave the Pack Behind'),(149,15,16,'Health Promotion/Awareness'),(150,12,16,'Ontario.'),(151,14,16,'Leave the Pack Behind (LTPB) is a student-led project that offers students information and education on the immediate health risks of smoking, nicotine addiction, and second hand smoke, as well as a wide range of effective, sustainable smoking-cessation services.'),(152,13,16,'For more information on LTPB and its activities on campus visit their website.'),(153,9,16,'Based on Client Need'),(154,5,16,'uoft.ltpb@gmail.com'),(155,4,16,'Koffler Student Services Centre'),(156,2,16,'231'),(157,11,16,'N'),(158,1,17,'University of Toronto'),(159,3,17,'University of Toronto - Downtown Toronto (St. George) Campus'),(160,19,17,'27 King\'s College Circle'),(161,18,17,'Toronto'),(162,17,17,'M5S1A1'),(163,16,17,'Peer Mentorship Program'),(164,15,17,'Peer/Self-help Support'),(165,12,17,'Ontario.'),(166,14,17,'Accessibility Services\' Peer Mentorship Program provides academic and social support to students registered with Accessibility Services. Our mission is to provide students with a network of resources to succeed at the University of Toronto, including both academic and co-curricular support. We strive to create a safe and comfortable community for students where they can navigate their disability and related barriers, facilitate peer support and interactions, and provide various academic and social opportunities.'),(167,13,17,'Must be registered with Accessibility Services to access the Peer Mentoring program.  On the Accessibility Services website, select a Registration Package that best describes your disability. Contact Accessibility Services to schedule an intake appointment. During your intake interview, you will have the opportunity to discuss any additional issues or concerns. If you do not have documentation of your disability, you can book an appointment for consultation.  If you have a learning disability or attention deficit hyperactivity disorder (ADHD) you may fill out the package without documentation. See website for more information about Accessibility Services.'),(168,9,17,'Based on Client Need'),(169,8,17,'416'),(170,7,17,'9788060'),(171,5,17,'accessibility.services@utoronto.ca'),(172,4,17,'215 Huron Street, 9th floor.'),(173,11,17,'N'),(174,1,18,'University of Toronto'),(175,3,18,'University of Toronto - Downtown Toronto (St. George) Campus'),(176,19,18,'27 King\'s College Circle'),(177,18,18,'Toronto'),(178,17,18,'M5S1A1'),(179,16,18,'Smoking Cessation'),(180,15,18,'Health Centre (Addictions)'),(181,12,18,'Ontario.'),(182,14,18,'Physicians at Health Services provide smoking cessation.'),(183,13,18,'Call to book an appointment or if you are a registered patient you can book an appointment through the Health Services Web Access Portal. The clinic also accepts drop-in appointments on a first-come, first-served basis. Health Card or Health Insurance and Student Identification is required.'),(184,9,18,'Based on Client Need'),(185,8,18,'416'),(186,7,18,'9788030'),(187,4,18,'Koffler Student Centre, Second Floor (St George entrance).'),(188,11,18,'N'),(189,1,19,'University of Toronto'),(190,3,19,'University of Toronto - Mississauga Campus'),(191,19,19,'3359 Mississauga Road N'),(192,18,19,'Mississauga'),(193,17,19,'L5L1C6'),(194,16,19,'AccessAbility Resource Centre'),(195,15,19,'Academic Accommodations'),(196,12,19,'Ontario.'),(197,14,19,'This service provides academic accommodations for University of Toronto students with disabilities.'),(198,13,19,'Call, drop in or email to book an appointment.  \nFor more information on applying on special consideration, please visit the University of Toronto Special Consideration website. For mental health academic accommodation you will require: 1.The Centre\'s Medical Certificate from a psychologist or psychiatrist stating the nature of the disability, characteristics of the disability, difficulties experienced, medication and side effects and recommended accommodations/strategies. 2. A letter from your high school citing the accommodations received (if applicable).'),(199,9,19,'Based on Client Need'),(200,8,19,'905'),(201,7,19,'5694699'),(202,5,19,'access.utm@utoronto.ca'),(203,4,19,'Davis Building'),(204,2,19,'2047'),(205,11,19,'N'),(206,1,20,'University of Toronto'),(207,3,20,'University of Toronto - Mississauga Campus'),(208,19,20,'3359 Mississauga Road N'),(209,18,20,'Mississauga'),(210,17,20,'L5L1C6'),(211,16,20,'Counselling and Psychiatry'),(212,15,20,'Counselling and Treatment'),(213,12,20,'Ontario.'),(214,14,20,'In addition to the medical care provided by the physicians and nurses, the HCC offers personal counselling or group therapy to assist students experiencing a wide range of challenges.  Counselling is provided by social workers, psychiatrist and physician-psychotherapist.'),(215,13,20,'Call or drop in to make an appointment.  First appointment is a 20 minute phone call with a counsellor.'),(216,10,20,'Cancellation of a psychiatric or personal counselling appointment requires at least 24 hours\' notice. Failure to give sufficient notification will result in a charge to you of $100 for psychiatric appointments and $60 for counselling appointments.'),(217,9,20,'5 Sessions'),(218,8,20,'905'),(219,7,20,'8285255'),(220,5,20,'health.utm@utoronto.ca'),(221,4,20,'Davis Building.'),(222,2,20,'1123'),(223,11,20,'Y'),(224,1,21,'University of Toronto'),(225,3,21,'University of Toronto - Mississauga Campus'),(226,19,21,'3359 Mississauga Road N'),(227,18,21,'Mississauga'),(228,17,21,'L5L1C6'),(229,16,21,'Know The Score 2'),(230,15,21,'Problem Gambling Awareness'),(231,12,21,'Ontario.'),(232,14,21,'An interactive problem gambling awareness program for college and university students.'),(233,13,21,'Any student enrolled at any college or university across Ontario can answer the five-question quiz online at kts2.ca or mj2.ca.  They can also visit the display located on 29 college and university campuses in the fall 2013 and winter 2014 semester.  Locations of the displays will be available on the English and French websites.  \nStudent staff can apply online via the two websites to help deliver the kts2 or mj2 program at the 29 campuses where there will be an on-campus display.  Once their application is received, they will be contacted via phone for an interview and if successful will participate in a paid training session at each of the campuses that the display will be set up on.  Training is mandatory.'),(234,9,21,'3 Days'),(235,5,21,'knowthescore@rgco.org or kts2@rgco.org'),(236,11,21,'N'),(237,1,22,'University of Toronto'),(238,3,22,'University of Toronto - Mississauga Campus'),(239,19,22,'3359 Mississauga Road N'),(240,18,22,'Mississauga'),(241,17,22,'L5L1C6'),(242,16,22,'Medical Care'),(243,15,22,'Counselling and Treatment'),(244,12,22,'Ontario.'),(245,14,22,'The UTM Health & Counselling Centre medical care team, consisting of  nurses, physicians, registered dietician and a psychiatrist, is experienced in working with diverse university populations and is comfortable discussing all topics related to student health and wellness.'),(246,13,22,'Walk in or call to book an appointment.  Appointments preferred. Health Card required (OHIP, Out of Province, International).'),(247,10,22,'Fees apply for missed appointments.  See website for information.'),(248,9,22,'Based on Client Need'),(249,8,22,'905'),(250,7,22,'8285255'),(251,5,22,'health.utm@utoronto.ca'),(252,4,22,'Davis Building.'),(253,2,22,'1123'),(254,11,22,'Y'),(255,1,23,'University of Toronto'),(256,3,23,'University of Toronto - Scarborough Campus'),(257,19,23,'1265 Military Trail'),(258,18,23,'Scarborough'),(259,17,23,'M1C1A4'),(260,16,23,'AccessAbility Services'),(261,15,23,'Academic Accommodations'),(262,12,23,'Ontario.'),(263,14,23,'The AccessAbility Services is a student service, academic service and University of Toronto (U of T) equity office on the U of T Scarborough campus.  Its principal function is to ensure that policies, practices, procedures and programs at the U of T Scarborough are inclusive to ensure the equal access to students with disabilities.\nThe office provides services and academic accommodations to students who have a documented learning, physical, sensory, mental health disability or medical condition.  Our services consider the students individual needs.'),(264,13,23,'Students are strongly encouraged to register with AccessAbility Services as early as possible to avoid a delay in service. The earlier a student registers, the better we will be able to develop an accommodation plan with a student.  Please contact the office regarding the documentation required to establish eligibility for services or go to our website.'),(265,9,23,'Based on Client Need'),(266,8,23,'416'),(267,7,23,'2877560'),(268,5,23,'ability@utsc.utoronto.ca'),(269,4,23,'Science Wing.'),(270,2,23,'302'),(271,11,23,'N'),(272,1,24,'University of Toronto'),(273,3,24,'University of Toronto - Scarborough Campus'),(274,19,24,'1265 Military Trail'),(275,18,24,'Scarborough'),(276,17,24,'M1C1A4'),(277,16,24,'Health & Wellness Centre - Crisis Counselling'),(278,15,24,'Crisis Intervention'),(279,12,24,'Ontario.'),(280,14,24,'During business hours students may attend the Health and Wellness Centre and staff will provide appropriate support and referrals.'),(281,13,24,'Call or drop in. Let reception know that you are in crisis.'),(282,9,24,'Based on Client Need'),(283,8,24,'416'),(284,7,24,'2877065'),(285,5,24,'health-services@utsc.utoronto.ca'),(286,4,24,'Student Centre.'),(287,2,24,'SL 270'),(288,11,24,'N'),(289,1,25,'University of Toronto'),(290,3,25,'University of Toronto - Scarborough Campus'),(291,19,25,'1265 Military Trail'),(292,18,25,'Scarborough'),(293,17,25,'M1C1A4'),(294,16,25,'Health & Wellness Centre - Health Services'),(295,15,25,'Health Centre (Mental Health)'),(296,12,25,'Ontario.'),(297,14,25,'For any health concern, doctors and nurses are available to the students at University of Toronto Scarborough.'),(298,13,25,'Drop in to see a nurse.  Doctor available by appointment only.'),(299,9,25,'Based on Client Need'),(300,8,25,'416'),(301,7,25,'2877065'),(302,5,25,'health-services@utsc.utoronto.ca'),(303,4,25,'Student Centre'),(304,2,25,'SL 270'),(305,11,25,'N'),(306,1,26,'University of Toronto'),(307,3,26,'University of Toronto - Scarborough Campus'),(308,19,26,'1265 Military Trail'),(309,18,26,'Scarborough'),(310,17,26,'M1C1A4'),(311,16,26,'Health & Wellness Centre - Personal Counselling'),(312,15,26,'Counselling and Treatment'),(313,12,26,'Ontario.'),(314,14,26,'Personal counselling allows you to meet one-on-one with a trained professional to confront concerns in a safe, non-judgmental atmosphere. Group therapy allows you to meet with several other individuals along with a trained professional, which allows for healing in an interpersonal context. Psychoeducational groups also available during the school year.'),(315,13,26,'Call or drop in to book an appointment. Student Identification and Health Card required.'),(316,9,26,'Based on Client Need'),(317,8,26,'416'),(318,7,26,'2877065'),(319,5,26,'health-s