'scarboroughout@gmail.com'),(2942,54,152,'www.ulife.utoronto.ca/organizations/view/id/38852'),(2943,55,152,'SCOUT creates a positive space on campus for Lesbian, Gay, Bisexual, Transgender, Transsexual, Intersex, Queer, Questioning and 2-Spirited students, staff and faculty. It\'s a space where LGBTQ folks and their Allies can meet, hang out or study.&nbsp;SCOUT&nbsp;provides safer sex resources both at the lounge and also in the Frosh kits every September.&nbsp;It creates visibility on campus by holding events and working with other campus groups as well as using posters, pamphlets and buttons.&nbsp;SCOUT strives to create a campus that is inclusive and welcoming to people of all genders and sexualities.'),(2944,60,152,'English'),(2945,61,152,'English'),(2946,29,153,'12469425'),(2947,30,153,'LGBTQ Student Club at University of Toronto St. George Campus'),(2948,31,153,'Lesbians, Gays, Bisexuals and Trans People of the University of Toronto (LGBTOUT)'),(2949,32,153,'ProgramAtSite'),(2950,33,153,'University of Toronto'),(2951,34,153,'73 St. George Street'),(2952,35,153,'Drop-in Centre, Sir Daniel Wilson Residence'),(2953,36,153,'Toronto'),(2954,37,153,''),(2955,38,153,'M5S 3L8'),(2956,41,153,'21 Sussex Avenue'),(2957,42,153,'Room 510'),(2958,43,153,'Toronto'),(2959,44,153,''),(2960,45,153,'Toronto'),(2961,46,153,'M5S 1J6'),(2962,47,153,''),(2963,49,153,'43.664805'),(2964,50,153,'79.402174'),(2965,52,153,'416-908-9212'),(2966,53,153,'exec@lgbtout.com'),(2967,54,153,'www.lgbtout.wordpress.com'),(2968,55,153,'LGBTOUT is the oldest LGBTQ (Lesbian, Gay, Bisexual, Trans, Queer) student organization in Canada and has served the U of T community for almost half a century.<br /><br />LGBTOUT provides resources and programming for LGBTQ students at U of T.'),(2969,60,153,'English'),(2970,61,153,'English'),(2971,29,154,'12477660'),(2972,30,154,'Undergraduate Student Union at University of Toronto Mississauga Campus'),(2973,31,154,'University of Toronto Mississauga Students\' Uni