 University life; to provide and coordinate services and programs that enable students with disabilities to maximize their educational potential and to increase awareness of inclusive values among all members of the University community.<br /><br />Services include:<br />- Counselling<br />- Multiple format tests and exams<br />- Notetaking<br />- Transcription of print materials into multiple formats<br />- Learning skills support for students with learning disabilities<br />- Access to assistive technology<br />- Outreach, education and disAbility resources<br />- Referrals<br />- Work and volunteer opportunities'),(4947,56,252,'Service available to University of Toronto students.'),(4948,60,252,'English'),(4949,61,252,'English'),(4950,29,253,'12477632'),(4951,30,253,'Accessibility Services at University of Toronto St. George Campus'),(4952,32,253,'ProgramAtSite'),(4953,33,253,'University of Toronto'),(4954,37,253,''),(4955,41,253,'130 St. George Street'),(4956,42,253,'Robarts Library, First Floor'),(4957,43,253,'Toronto'),(4958,44,253,''),(4959,45,253,'Toronto'),(4960,46,253,'M5S 3H1'),(4961,47,253,''),(4962,51,253,'Office closed for lunch from 12:30pm-1:30pm.Summer hours (July-August):Mon-Fri, 8:45am-4:30pm.'),(4963,52,253,'416-978-8060'),(4964,53,253,'accessibility.services@utoronto.ca'),(4965,54,253,'www.accessibility.utoronto.ca'),(4966,55,253,'Accessibility Services at the University of Toronto aims to ensure that all students with disabilities can freely and actively participate in all facets of University life; to provide and coordinate services and programs that enable students with disabilities to maximize their educational potential and to increase awareness of inclusive values among all members of the University community.<br /><br />Services include:<br />- Test and exam accommodations<br />- Support in determining and negotiating effective accommodations<br />- Expertise in learning strategies and adaptive technology<br />- Access to funding for disa