s include: Academic supports; Admissions support; Financial aid counselling; Bursaries and scholarships; Housing, daycare and employment referrals; Resource centre/library; Work study program; Elders and traditional teachers; Events; Computer lab; Native Student Association.'),(5060,60,257,'English'),(5061,61,257,'English'),(5062,29,258,'12469367'),(5063,30,258,'Health Services at University of Toronto Mississauga Campus'),(5064,31,258,'Health and Counselling Centre'),(5065,32,258,'ProgramAtSite'),(5066,33,258,'University of Toronto'),(5067,34,258,'3359 Mississauga Road North'),(5068,35,258,'Room 1123, South Building'),(5069,36,258,'Mississauga'),(5070,37,258,''),(5071,38,258,'L5L 1C6'),(5072,41,258,'3359 Mississauga Road North'),(5073,42,258,'Room 1123, South Building'),(5074,43,258,'Mississauga'),(5075,44,258,''),(5076,45,258,'Peel'),(5077,46,258,'L5L 1C6'),(5078,47,258,''),(5079,51,258,'Closed 12:00pm-12:30pm on Mondays and Fridays.Early summer hours (May-June):Mon-Fri, 9am-12pm, 1pm-5pmLate summer hours (July-August):Mon-Fri, 9am-12pm, 1pm-4:30pm'),(5080,52,258,'905-828-5255'),(5081,53,258,'health.utm@utoronto.ca'),(5082,54,258,'www.utm.utoronto.ca/health'),(5083,55,258,'The University of Toronto Mississauga Health and Counselling medical staff is experienced in working with diverse university populations and is comfortable discussing all topics related to student health and wellness. Students can make appointments with one of the student-friendly physicians or nurses to discuss a wide range of health concerns including:<br />- First aid of injuries<br />- Sports injuries<br />- Immunizations<br />- Allergies<br />- Chronic illnesses<br />- Physical exams<br />- Cold and flu<br />- Referrals<br />- Birth control<br />- Sexually transmitted infections (STIs)<br />- Pregnancy testing'),(5084,56,258,'Services available to University of Toronto students.'),(5085,57,258,'Located around the corner from the campus Bookstore.'),(5086,60,258,'English'),(5087,61,258,'Engl