60,'M5T 2Z9'),(5128,47,260,''),(5129,51,260,'The Health Services is closed for all statutory holidays.Summer hours:Mon, Thurs, Fri: 9:00am - 4:30pmTue, Wed: 9:00am - 7:00pm'),(5130,52,260,'416-978-8030'),(5131,53,260,'nancyd.pollock@utoronto.ca'),(5132,54,260,'www.healthservices.utoronto.ca/Main.htm'),(5133,55,260,'Health Services offers University of Toronto students the same services as a family doctor&#39;s office.&nbsp; The multidisciplinary team includes physicians, registered nurses, a dietician, and support staff.&nbsp; Health Services provides confidential, student-centered health care, including comprehensive medical care, travel medicine and education, immunization, and referrals for specialized treatment.<br /><br />Services include:<br />- Allergy care<br />- Birth control, STI education and care, emergency contraception<br />- Diagnostic facilities<br />- Disability documentation<br />- Disordered eating care, counselling and education<br />- Immunization and TB testing<br />- Men&#39;s health<br />- Nutrition counselling and education<br />- Pregnancy support<br />- Periodic health exam<br />- Smoking cessation<br />- Travel health education and immunizations<br />- Wart removal<br />- Women&#39;s health<br />- Wound care'),(5134,56,260,'Services offered to University of Toronto students.'),(5135,60,260,'English'),(5136,61,260,'English'),(5137,29,261,'12469423'),(5138,30,261,'LGBTQ Student Club at University of Toronto Mississauga Campus'),(5139,31,261,'OUT@UTM'),(5140,32,261,'ProgramAtSite'),(5141,33,261,'University of Toronto'),(5142,34,261,'Student Centre, Room 240'),(5143,37,261,''),(5144,41,261,'Student Centre, Room 240'),(5145,44,261,''),(5146,47,261,''),(5147,53,261,'out@utmsu.ca'),(5148,54,261,'www.outatutm.tumblr.com'),(5149,55,261,'OUT@UTM is dedicated to providing a campus atmosphere for Lesbian, Gay, Bisexual, Transgender, Transsexual, Intersex, Queer, Questioning, Two-Spirit and Asexual students and their Allies at the University of Toronto at Mississauga that is both welcoming and supportive though social, educational, and cultural events. The OUT office in the student centre is&nbsp;open daily during the regular school session to serve as a positive space for Queer, Trans and Genderqueer students and their Allies.Out@UTM is open to everyone who wishes to attend.'),(5150,60,261,'English'),(5151,61,261,'English'),(5152,29,262,'12469424'),(5153,30,262,'LGBTQ Student Club at University of Toronto Scarborough Campus'),(5154,31,262,'Scarborough Campus OUT (SCOUT)'),(5155,32,262,'ProgramAtSite'),(5156,33,262,'University of Toronto'),(5157,34,262,'Bladen Wing, BV336'),(5158,37,262,''),(5159,41,262,'Bladen Wing, BV336'),(5160,44,262,''),(5161,47,262,''),(5162,53,262,'scarboroughout@gmail.com'),(5163,54,262,'www.ulife.utoronto.ca/organizations/view/id/38852'),(5164,55,262,'SCOUT creates a positive space on campus for Lesbian, Gay, Bisexual, Transgender, Transsexual, Intersex, Queer, Questioning and 2-Spirited students, staff and faculty. It\'s a space where LGBTQ folks and their Allies can meet, hang out or study.&nbsp;SCOUT&nbsp;provides safer sex resources both at the lounge and also in the Frosh kits every September.&nbsp;It creates visibility on campus by holding events and working with other campus groups as well as using posters, pamphlets and buttons.&nbsp;SCOUT strives to create a campus that is inclusive and welcoming to people of all genders and sexualities.'),(5165,60,262,'English'),(5166,61,262,'English'),(5167,29,263,'12469425'),(5168,30,263,'LGBTQ Student Club at University of Toronto St. George Campus'),(5169,31,263,'Lesbians, Gays, Bisexuals and Trans People of the University of Toronto (LGBTOUT)'),(5170,32,263,'ProgramAtSite'),(5171,33,263,'University of Toronto'),(5172,34,263,'73 St. George Street'),(5173,35,263,'Drop-in Centre, Sir Daniel Wilson Residence'),(5174,36,263,'Toronto'),(5175,37,263,''),(5176,38,263,'M5S 3L8'),(5177,41,263,'21 Sussex Avenue'),(5178,42,263,'Room 510'),(5179,43,26