dvising-services'),(5336,55,271,'In addition to being provided through individual academic departments, academic counselling at the University of Toronto Mississauga is provided through the Office of the Registrar.&nbsp; The Office of the Registrar provides information related to degree requirements, university rules and regulations, interpretation of the Academic Calendar, and personal or academic concerns that influence academic performance.<br /><br />Students should make an appointment with an advisor for the following situations:<br />- Degree Check<br />- Petition or appeal<br />- Adding/dropping/withdrawing courses<br />- Transferring to/from other universities<br />- Program entry requirements<br />- Grade/GPA calculation<br />- Other academic-related topics<br />- OSAP/Financial aid<br />- Tuition fees<br /><br />Note: If students have questions or concerns pertaining to their respective programs, individual courses or instructor conduct should contact their departmental advisor - see website for details.'),(5337,56,271,'University of Toronto Mississauga students.'),(5338,58,271,'Appointment Required - Students can book an appointment by using a computer terminal set up inside of the Office of the Registrar.'),(5339,59,271,'Student ID (TCard)'),(5340,60,271,'English'),(5341,61,271,'English'),(5342,29,272,'15754770'),(5343,30,272,'University of Toronto Academic Advising at University of Toronto Scarborough Campus'),(5344,31,272,'University of Toronto Scarborough Academic Advising & Career Centre'),(5345,32,272,'ProgramAtSite'),(5346,33,272,'University of Toronto'),(5347,34,272,'1265 Military Trail'),(5348,35,272,'Academic Resource Centre, Room AC213'),(5349,36,272,'Scarborough'),(5350,37,272,''),(5351,38,272,'M1C 1A4'),(5352,41,272,'1265 Military Trail'),(5353,42,272,'Academic Resource Centre, Room AC213'),(5354,43,272,'Scarborough'),(5355,44,272,''),(5356,45,272,'Toronto'),(5357,46,272,'M1C 1A4'),(5358,47,272,''),(5359,52,272,'416-287-7561'),(5360,53,272,'a