0,'2014-08-27 11:39:46',NULL,NULL,0,NULL),(3337,3227,'ChIJjVdESBE0K4gR4GmmxP21kaA',1,'en_US',0,'Davenport Perth Neighbourhood and Community Health Centre - Health Clinic','The Davenport Perth Health Centre provides primary care for clients using a multi-disciplinary team of doctors, nurses, nurse-practitioners, counsellor/therapists, dietitians and medical administration staff. The health services offered by DPNCHC are restricted to those living in the catchment area.','2014-07-28 22:53:00',1,1,0,'2014-08-27 11:39:46',NULL,NULL,0,NULL),(3331,3221,'ChIJOZM876-lIIYR9S1Y-yAa6OY',1,'en_US',0,'Office of Health Professions Student Affairs','Provides personal and couples counseling and career decision advice to health professional students','2014-07-28 22:35:00',1,1,0,'2014-08-27 11:39:46',NULL,NULL,0,NULL),(3332,3222,'ChIJTws7NUvL1IkRswhEXvIkzdc',1,'en_US',0,'Ryerson Recreation and Athletics Center','Facility for intramurals, open recreation, sports clubs, badminton, basketball, soccer &amp; volleyball','2014-07-28 22:39:00',1,1,0,'2014-08-27 11:39:46',NULL,NULL,0,NULL),(3333,3223,'ChIJ-2ibnEs0K4gRoGNusXBjA-0',1,'en_US',0,'Sorauren Farmer\'s Market','A family friendly market in Sorauren Park. Fresh and local produce available. Great place to stroll, socialize, and learn about healthy and sustainable eating!','2014-07-28 22:36:00',1,1,0,'2014-08-27 11:39:46',NULL,NULL,0,NULL),(3330,3220,'ChIJhzfbGFg0K4gRqKvu_bm9nIc',1,'en_US',0,'Sunshine Wholesome Market','This health food store has it all! They sell numerous types of fresh immune-booting juices and smoothies, excellent for when you are feeling sick. They also have healthy prepared foods, as well as the possibility to customize your own healthy salad. The staff is friendly and knowledgeable.','2014-07-28 22:29:00',1,1,0,'2014-08-27 11:39:46',NULL,NULL,0,NULL),(3329,3219,'ChIJiZoptbQ0K4gR6b-AhlvIqfI',1,'en_US',0,'Mattamy Athletic Centre','cardio room, free weights as well as a wide variety of machine weights and a sprung ha