INSERT INTO `page` VALUES (1,'About','&lt;div class=\"main-content\"&gt; &lt;div class=\"section\" id=\"section-1\"&gt; &lt;h2 title=\"Purpose\"&gt;The Purpose of This Map&lt;/h2&gt; &lt;p&gt;Thought Spot is a map of mental health resources that uses a crowdsourcing model, allowing for interaction and contribution by student users.&lt;/p&gt; &lt;/div&gt; &lt;div class=\"section\" id=\"section-1a\"&gt; &lt;img src=\"/themes/thought-spot/images/infographics/infographics/schoolpop-v03.png\" class=\"infographic-studentpop infographic\" /&gt; &lt;/div&gt; &lt;div class=\"section\" id=\"section-2\"&gt; &lt;h2 title=\"Values\"&gt;Values&lt;/h2&gt; &lt;div class=\"value\" id=\"value-1\"&gt; &lt;h3&gt;Community&lt;/h3&gt; &lt;p&gt;Thought Spot uses a participatory approach to identifying resources. The growth and development of the project depends on an inclusive and collaborative environment made for students by students.&lt;/p&gt; &lt;/div&gt; &lt;div class=\"value\" id=\"value-2\"&gt; &lt;h3&gt;Positivity&lt;/h3&gt; &lt;p&gt;Thought Spot takes a holistic approach to mental health. By treating body and mind as one, we hope to raise awareness of the role of mental well-being in improving the lives of everyone.&lt;/p&gt; &lt;/div&gt; &lt;div class=\"value\" id=\"value-3\"&gt; &lt;h3&gt;Knowledge&lt;/h3&gt; &lt;p&gt;Thought Spot is a comprehensive resource with data from relevant sources. This innovative mapping approach makes access to resources easy and interactive by mobilizing students to share knowledge and build networks.&lt;/p&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class=\"section\" id=\"section-3\"&gt; &lt;h2&gt;Partners&lt;/h2&gt; &lt;p class=\"partner-images\"&gt; &lt;img src=\"/themes/thought-spot/images/partner-logos-colour/camh.png\" class=\"partner-logo\" id=\"partner-logo-1\" title=\"camh\" /&gt; &lt;img src=\"/themes/thought-spot/images/partner-logos-colour/connex.png\" class=\"partner-logo\" id=\"partner-logo-2\" title=\"Connex Ontario\" /&gt; &lt;img src=\"/themes/thought-spot/images/partner-logos-colour/ocad.png\" class=\"partner-logo\" id=\"partner-logo-3\" title=\"OCAD University\" /&gt; &lt;img src=\"/themes/thought-spot/images/partner-logos-colour/ryerson.png\" class=\"partner-logo\" id=\"partner-logo-4\" title=\"Ryerson University\" /&gt; &lt;img src=\"/themes/thought-spot/images/partner-logos-colour/uoft.png\" class=\"partner-logo\" id=\"partner-logo-5\" title=\"University of Toronto\" /&gt; &lt;img src=\"/themes/thought-spot/images/partner-logos-colour/dmz.png\" class=\"partner-logo\" id=\"partner-logo-6\" title=\"Ryerson Digital Media Zone\" /&gt; &lt;/p&gt; &lt;p style=\"clear: both;\"&gt;Thought Spot is funded through a 2013 Mental Health Innovation Fund grant administered by the Ministry of Training, Colleges and Universities.&lt;/p&gt; &lt;p&gt;This student engagement and online advocacy project was initiated by the Centre for Addiction and Mental Health (CAMH) and the University of Toronto. Initial map data was provided by ConnexOntario and Kids Help Phone. OCAD University, Ryerson University and the University of Toronto were present on the Steering Committee and facilitated links to on-campus groups, programs and services. The Digital Media Zone at Ryerson provided meeting space and will host our Hack for Mental Health event in November.&lt;/p&gt; &lt;/div&gt; &lt;div class=\"section\" id=\"section-4\"&gt; &lt;h2&gt;Team&lt;/h2&gt; &lt;div class=\"team\" id=\"team-1\"&gt; &lt;h3&gt;Student Production Team&lt;/h3&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Antonio Lee&lt;/h4&gt; &lt;p class=\"team-name\"&gt;Content Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;University of Toronto&lt;/p&gt; &lt;p class=\"spot-name\"&gt;The Rex Jazz Bar&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Debi Banerjee&lt;/h4&gt; &lt;p class=\"team-name\"&gt;Content Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;University of Toronto&lt;/p&gt; &lt;p class=\"spot-name\"&gt;High Park&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Heather Hart&lt;/h4&gt; &lt;p class=\"team-name\"&gt;Content Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;Ryerson University&lt;/p&gt; &lt;p class=\"spot-name\"&gt;Ryerson Athletic Centre&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Phoebe Bao&lt;/h4&gt; &lt;p class=\"team-name\"&gt;Content Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;University of Toronto&lt;/p&gt; &lt;p class=\"spot-name\"&gt;Hart House&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Carolyn Rowan&lt;/h4&gt; &lt;p class=\"team-name\"&gt;Content Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;University of Toronto&lt;/p&gt; &lt;p class=\"spot-name\"&gt;Trinity Bellwoods Dog Bowl&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Kathryn Hartog&lt;/h4&gt; &lt;p class=\"team-name\"&gt;&lt;span title=\"User Experience\"&gt;UX&lt;/span&gt; Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;Ryerson University&lt;/p&gt; &lt;p class=\"spot-name\"&gt;Art Gallery of Ontario&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Tammy Le&lt;/h4&gt; &lt;p class=\"team-name\"&gt;&lt;span title=\"User Experience\"&gt;UX&lt;/span&gt; Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;Sheridan College&lt;/p&gt; &lt;p class=\"spot-name\"&gt;Toronto Waterfront&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Dena Javadi&lt;/h4&gt; &lt;p class=\"team-name\"&gt;Marketing Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;Johns Hopkins University (grad)&lt;/p&gt; &lt;p class=\"spot-name\"&gt;Royal Ontario Museum&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Claire Hamilton&lt;/h4&gt; &lt;p class=\"team-name\"&gt;Marketing Team&lt;/p&gt; &lt;p class=\"school-name\"&gt;OCAD University&lt;/p&gt; &lt;p class=\"spot-name\"&gt;West End YMCA&lt;/p&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class=\"team\" id=\"team-2\"&gt; &lt;h3&gt;Collaborative Leadership&lt;/h3&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Miriam Verburg&lt;/h4&gt; &lt;p class=\"positon-name\"&gt;Project Manager&lt;/p&gt; &lt;p class=\"org-name\"&gt;&lt;a href=\"http://www.bloomdigital.to/\"&gt;Bloom Digital Media&lt;/a&gt;&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Andrew Johnson and Michelle Hamilton-Page&lt;/h4&gt; &lt;p class=\"positon-name\"&gt;Project Coordinators&lt;/p&gt; &lt;p class=\"org-name\"&gt;CAMH Education&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Farah Friesen&lt;/h4&gt; &lt;p class=\"positon-name\"&gt;Student Engagement Specialist&lt;/p&gt; &lt;p class=\"org-name\"&gt;University of Toronto&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Christine Fitzgerald&lt;/h4&gt; &lt;p class=\"positon-name\"&gt;UX Team Mentor and Hackathon Coordinator&lt;/p&gt; &lt;p class=\"org-name\"&gt;&lt;a href=\"http://ahamomentinc.com/\"&gt;Aha Moment, Inc.&lt;/a&gt;&lt;/p&gt; &lt;/div&gt; &lt;div class=\"person\"&gt; &lt;h4 class=\"name\"&gt;Laura Gibbs&lt;/h4&gt; &lt;p class=\"positon-name\"&gt;Workshop Coordinator&lt;/p&gt; &lt;p class=\"org-name\"&gt;CAMH Education&lt;/p&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt;','About',1),(2,'FAQ','<!-- faq page --> <div class=\"main-content\"> <div class=\"section\" id=\"section-1\"> <h2 title=\"FAQ\">Frequently Asked Questions</h2> <p>Here are some answers to popular questions about Thought Spot. If you have a question that is not answered below, feel free to <a href=\"/contact\">contact us</a>. </p> </div> <div class=\"section\" id=\"section-2\"> <h2>Overview</h2> <a href=\"#section-2\" class=\"expand-all button\">Expand All</a> <div class=\"q-and-a\"> <h3 class=\"question\">What is Thought Spot\'s definition of mental health and wellbeing?</h3> <div class=\"answer\"><p>The World Health Organization defines mental health as: \"A state of well-being in which every individual realizes his or her own potential, can cope with the normal stresses of life, can work productively and fruitfully, and is able to make a contribution to her or his community.\" <a href=\"http://who.int/features/qa/62/en/\" target=\"_blank\">(source)</a></p> <p>Thought Spot uses a broad definition of mental health. We believe that mental health exists on a continuum and includes how you feel and think about your life.</p></div> </div> <div class=\"q-and-a\"> <h3 class=\"question\">What and who is this map for?</h3> <p class=\"answer\">Thought is for any post-secondary student searching for resources within the Greater Toronto Area. Thought Spot is designed to help you cope with life stressors and to meet personal mental health needs. </p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Who is this map not for? </h3> <p class=\"answer\">Thought Spot is not meant to be a resource for someone in crisis. If you believe that you or a friend is in crisis, please call 9-1-1 immediately. </p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">I am not a post-secondary student. Can I still use this map?</h3> <p class=\"answer\">Thought Spot is designed for post-secondary students who are currently enrolled in a university or college in the Greater Toronto Area, but many of the Spots are open to non-students. </p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">What is a crisis?</h3> <p class=\"answer\">A crisis is a crucial, decisive moment or situation where an emotionally stressful event or traumatic change is taking place. Someone in crisis cannot wait for an appointment, and needs an immediate connection with some sort of service (e.g., 9-1-1 or a hotline).</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">I think I am in a crisis. I would like to talk to someone.</h3> <p class=\"answer\">If you believe that you are in crisis, please call <strong>9-1-1</strong> immediately.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Im not in a crisis but I would still like to talk to someone right away.</h3> <ul class=\"answer\">Please use the following resources: <li><a href=\"http://www.good2talk.ca/\" target=\"_blank\">Good2Talk</a> (for ages 17 to 25): 1-866-925-5454 or 2-1-1</li> <li><a href=\"http://www.kidshelpphone.ca/Teens/Home.aspx\" target=\"_blank\">Kids Help Phone</a> (for ages 20 and under): 1-800-668-6868</li> <li><a href=\"http://www.drugandalcoholhelpline.ca/\" target=\"_blank\">ConnexOntario</a> Drug and Alcohol Helpline: 1-800-565-8603</li> <li><a href=\"http://www.mentalhealthhelpline.ca/\" target=\"_blank\">ConnexOntario</a> Mental Health Helpline: 1-866-531-2600</li> <li><a href=\"http://www.problemgamblinghelpline.ca/\" target=\"_blank\">ConnexOntario</a> Ontario Problem Gambling Helpline: 1-888-531-3505</li> </ul> </div> <div class=\"q-and-a\"> <h3 class=\"question\">What can I use this map for?</h3> <p class=\"answer\">Resources on the map are divided into seven different categories that are described in the <a href=\"#category-question\">next section</a>. Whether you are searching for an invigorating fitness program, beneficial health service, useful legal or financial advice, or even a place to de-stress and relax, this map can direct you to various locations that correspond to your needs and preferences.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Where is the information on the map from?</h3> <p class=\"answer\">The map is a continuously developing product. Although the map is based on mental health resource databases from Kids Help Phone and ConnexOntario, it continues to evolve from information provided by post-secondary students who are users themselves.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Are any of these sources sponsored by the Centre for Addiction and Mental Health or University of Toronto?</h3> <p class=\"answer\">The Centre for Addiction and Mental Health and University of Toronto do not sponsor nor endorse any one particular resource. </p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Is this map available for other cities?</h3> <p class=\"answer\">At the moment, Thought Spot only displays resources in the Greater Toronto Area.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">I am a representative from a mental health resource in the Greater Toronto Area. How can I add the location to the map?</h3> <p class=\"answer\"><a href=\"/contact\">Contact us</a>. Thanks!</p> </div> </div> <div class=\"section\" id=\"section-3\"> <h2>Map Content</h2> <a href=\"#section-3\" class=\"expand-all button\">Expand All</a> <div class=\"q-and-a\"> <h3 class=\"question\">How do I know which resources are right for me?</h3> <p class=\"answer\">Use the <a href=\"/reports\">filter system on the spot page</a> to help you navigate the resources listed in the map.</p> </div> <div class=\"q-and-a\" id=\"category-question\"> <h3 class=\"question\">What do the different categories on the map mean?</h3> <ul class=\"answer category-faq\" id=\"category-descriptions\"> <li class=\"work-and-school\"><h5>Work and School</h5>Services made available by universities, colleges and workplaces in the Greater Toronto Area that provide advice, support, or programming related to education and employment.</li> <li class=\"family-and-friends\"><h5>Family and Friends</h5>Places of support for the family unit (e.g., parents and child) or places to meet and bond with new friends.</li> <li class=\"legal-and-financial\"><h5>Legal and Fincancial</h5>Places that offer legal assistance (e.g., legal representation, legal aid application) and resources for financial management and planning.</li> <li class=\"sex-and-relationships\"><h5>Sex and Relationships</h5>Places that provide information and services for promoting safe and healthy relationships and offer resources and services related to sexual and reproductive health.</li> <li class=\"recreation-and-culture\"><h5>Recreation and Culture</h5>Places that offer activities and services which cater to various artistic, musical, cultural, ethnic, or physical activity programming.</li> <li class=\"health-and-social-services\"><h5>Health and Social Services</h5>Sites that offer medical clinics, housing services, social support systems, and connections to fulfill mental, physical or emotional needs.</li> <li class=\"spirituality-and-wellbeing\"><h5>Spirituality and Wellbeing</h5>Places that offer services to promote a healthy and spiritually-aware lifestyle including, gyms, yoga studios, fitness groups or classes, spiritual or religious services, and much more.</li> </ul> </div> <div class=\"q-and-a\"> <h3 class=\"question\">I found a mistake on the map. How do I report it?</h3> <p class=\"answer\">On individual spot pages you can upvote or downvote the veracity of each spot, or <a href=\"/contact\">contact us</a>. Thanks!</p> </div> <!--<div class=\"q-and-a\"> <h3 class=\"question\">How do I register? Why should I register?</h3> <p class=\"answer\"><a href=\"/login/?newaccount\">Registration</a> is quick, simple, and free. As a registered Thought Spot member, you will be able to actively contribute to the map by adding relevant locations of interest in one or more of the seven categories. You will also be able to provide helpful reviews and recommendations on places for others to view.</p> </div>--> <div class=\"q-and-a\"> <h3 class=\"question\">How do I add a spot to the map?</h3> <p class=\"answer\"><a href=\"/page/index/3\" title=\"get involved\">Join or lead a crowdsourcing workshop</a>. Workshops are designed to help identify useful resources and moderate additions to the map.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">If I add a spot, will this be tracked back to me?</h3> <p class=\"answer\">No; all entries are completely anonymous.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Which resources can be added to the map?</h3> <p class=\"answer\">The Thought Spot project uses crowdsourcing to allow students themselves to identify helpful local resources for mental health and wellbeing. As long as you believe a resource has helped you in this capacity, it can be added to the map. Moderators will screen all data for spam and other irrelevant information.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">What does crowdsourcing mean?</h3> <p class=\"answer\">Crowdsourcing is an exercise involving the public in gathering accurate and up-to-date information. Crowdsourcing is a way for students who may use Thought Spot to locate and add mental health resources to the map. In addition to supplying new resources, students can review existing resources and add comments. Crowdsourcing takes place in <a href=\"/page/index/3\" title=\"get involved\">workshops</a>.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Is there a mobile app for Thought Spot?</h3> <p class=\"answer\">Not yet, but look out for the hackathon event coming in November 2014 where groups of post-secondary students and recent graduates can come together to collaboratively build mobile solutions for the Thought Spot community. If you are a designer, engineer, product manager, or mental health advocate who would like to participate, <a href=\"/contact?subject=hackathon\">contact us</a> with the subject line Hackathon Information for more information.</p> </div> </div> <!-- /div id=section-2 --> <div class=\"section\" id=\"section-4\"> <h2>Workshops</h2> <a href=\"#section-4\" class=\"expand-all button\">Expand All</a> <div class=\"q-and-a\"> <h3 class=\"question\">What are the workshops?</h3> <div class=\"answer\"><p>Workshops are a way for post-secondary students to contribute to and use the Thought Spot map! There are two kinds of workshops: Crowdsourcing and Do-It-Yourself (DIY). In Crowdsourcing Workshops, Thought Spot volunteers guide participants through a series of activities that help us check existing map data for accuracy and add new Thought Spots to the map. These workshops ensure that map users find up-to-date information. </p> <p>Just want to learn how to use Thought Spot or show other students how to find local mental health resources? Then the DIY Workshop is for you! Print out our workshop guide (coming soon!), choose a route, and set out on your Thought Spot walking tour. DIY Workshops can be hosted by anyone servicing post-secondary students (e.g., university registrar, residence dons, student organizations or clubs) andare great team building activities. For more information on the workshops click <a href=\"/page/index/3#section-3\" title=\"Get Involved\">here</a>.</p></div> </div> <div class=\"q-and-a\"> <h3 class=\"question\">Who is the workshop for?</h3> <p class=\"answer\">Students from any of the colleges or universities in the Greater Toronto Area are eligible to participate in the workshops. Students studying part-time, international students, mature students, and students in undergraduate, professional, or graduate programs are all welcome.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">How long is each workshop?</h3> <p class=\"answer\">Workshops take approximately 90 minutes.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">How can I join a workshop?</h3> <p class=\"answer\">Crowdsourcing Workshops are hosted by the Thought Spot volunteers. For a schedule of upcoming workshops and events, please access the <a href=\"/page/index/3\">Get Involved page</a>. DIY Workshops can be run by anyone  just download the workshop guide (coming soon!).</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">How can I host a Crowdsourcing Workshop?</h3> <p class=\"answer\">Please <a href=\"/contact\">contact us</a>.</p> </div> <div class=\"q-and-a\"> <h3 class=\"question\">What if I need help or have questions about running a DIY workshop?</h3> <p class=\"answer\">No problem! Please <a href=\"/contact\">contact us</a>.</p> </div> </div> </div>','FAQ',1),(3,'Get Involved','&lt;!-- get involved --&gt; &lt;div class=\"main-content\"&gt; &lt;div class=\"section\" id=\"section-1\"&gt; &lt;h2&gt;Get Involved&lt;/h2&gt; &lt;p&gt;Thought Spot is a crowdsourced map for finding mental health and wellbeing resources in the GTA. It was designed by students, for students. We invite students from all backgrounds and experiences to participate and contribute to the map with their own Thought Spots and help other students.&lt;/p&gt; &lt;/div&gt; &lt;div class=\"section\" id=\"section-1a\"&gt; &lt;p&gt;This map is for you &amp;mdash; so help us make it great! Check out the infographic for ways to get involved.&lt;/p&gt; &lt;div class=\"infographic-getinvolved infographic\"&gt; &lt;img src=\"/themes/thought-spot/images/infographics/infographics/getinvolved-v03_01.png\" /&gt; &lt;a href=\"/contact?subject=workshop\"&gt;&lt;img src=\"/themes/thought-spot/images/infographics/infographics/getinvolved-v03_02.png\" /&gt;&lt;/a&gt; &lt;a href=\"/contact?subject=suggestion\"&gt;&lt;img src=\"/themes/thought-spot/images/infographics/infographics/getinvolved-v03_03.png\" /&gt;&lt;/a&gt; &lt;a href=\"/contact?subject=workshop\"&gt;&lt;img src=\"/themes/thought-spot/images/infographics/infographics/getinvolved-v03_04.png\" /&gt;&lt;/a&gt; &lt;a href=\"https://www.facebook.com/MyThoughtSpot\" target=\"_blank\"&gt;&lt;img src=\"/themes/thought-spot/images/infographics/infographics/getinvolved-v03_05.png\" /&gt;&lt;/a&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class=\"section\" id=\"section-2\"&gt; &lt;h2&gt;Workshops&lt;/h2&gt; &lt;p&gt;Workshops are a way for post-secondary students to contribute to and use the Thought Spot map! Workshops can be organized by your student group, class, or residence don. Read on to learn about the different workshops we offer:&lt;/p&gt; &lt;div class=\"workshop\" id=\"workshop-1\"&gt; &lt;h3&gt;Crowdsourcing&lt;/h3&gt; &lt;p&gt;In this workshop, student participants have the opportunity to explore uploaded resources on the Thought Spot map, update information on an existing spot, add new spots to the map, or provide comments/feedback on resources they have previously used. &lt;/p&gt; &lt;p&gt;It\'s a fun way to contribute directly to the Thought Spot map as an editor, author, critic (or all three!) while exploring mental health resources in the GTA!&lt;/p&gt; &lt;p&gt;Please &lt;a href=\"/contact\"&gt;contact our team&lt;/a&gt; for upcoming facilitator or participant opportunities.&lt;/p&gt; &lt;div class=\"button\"&gt;&lt;a href=\"/contact\" class=\"button\"&gt;Get More Info&lt;/a&gt;&lt;/div&gt; &lt;/div&gt; &lt;div class=\"workshop\" id=\"workshop-2\"&gt; &lt;h3&gt;DIY&lt;/h3&gt; &lt;p&gt;In this workshop, student participants learn about the maps functionalities and link spots with their physical location while touring around a given area. Students have the chance to become better familiarized with a particular neighborhood and the community in which they live. &lt;/p&gt; &lt;p&gt;DIY Workshops are a fun and engaging way for specific student groups (e.g., international students) to learn about available resources in the community and network with fellow peers.&lt;/p&gt; &lt;p&gt;Interested in hosting a DIY Workshop? Download our step-by-step guide! &lt;/p&gt; &lt;div class=\"button\"&gt;&lt;a href=\"/contact\" class=\"button\"&gt;Get Toolkit&lt;/a&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class=\"section\" id=\"section-3\"&gt; &lt;div class=\"news-feed\" id=\"feed-1\"&gt; &lt;h2 title=\"News and Events\"&gt;Coming Events&lt;/h2&gt; &lt;iframe src=\"https://www.google.com/calendar/embed?showTitle=0&amp;amp;showNav=0&amp;amp;showPrint=0&amp;amp;showCalendars=0&amp;amp;showTz=0&amp;amp;height=320&amp;amp;wkst=1&amp;amp;bgcolor=%23FFFFFF&amp;amp;src=mythoughtspot.ca%40gmail.com&amp;amp;color=%232952A3&amp;amp;ctz=America%2FToronto\" style=\" border-width:0 \" width=\"285\" height=\"320\" frameborder=\"0\" scrolling=\"no\"&gt;&lt;/iframe&gt; &lt;/div&gt; &lt;div class=\"news-feed\" id=\"feed-2\"&gt; &lt;h2 title=\"Twitter\" id=\"section-4\"&gt;Twitter Feed&lt;/h2&gt; &lt;a class=\"twitter-timeline\" href=\"https://twitter.com/mythoughtspot\" data-widget-id=\"503976140818505729\"&gt;Tweets by @mythoughtspot&lt;/a&gt; &lt;script&gt;!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\'http\':\'https\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\"://platform.twitter.com/widgets.js\";fjs.parentNode.insertBefore(js,fjs);}}(document,\"script\",\"twitter-wjs\");&lt;/script&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt;','Get Involved',1),(4,'Privacy Policy','&lt;!-- privacy page --&gt; &lt;div class=\"section\" id=\"section-2\"&gt; &lt;h2 title=\"Privacy and Confidentiality\"&gt;Website privacy and confidentiality policy&lt;/h2&gt; &lt;p&gt;The Centre for Addiction and Mental Health (\"we\", \"us\" or \"CAMH\") is committed to maintaining the privacy of all individuals who use the resources available at www.mythoughtspot.ca (\"the Site\"). &lt;p&gt;CAMH places a high value on privacy, both in person and online. Please visit CAMH\'s general privacy pages to learn more about our overall commitment to protecting the personal information of our patients and clients, and of any other individuals whose personal information we collect. These pages contain general information about our Privacy Office, our Privacy Notice, and our Privacy Policy.&lt;/p&gt; &lt;p&gt;This Site may contain links to other web sites. Upon entering other web sites, you are subject to the privacy and security policies of those sites. This policy identifies our Site\'s privacy practices only.&lt;/p&gt; &lt;p&gt;Only limited personal information (which means personally-identifiable information including, without limitation, user, password and e-mail address) is collected from users of this Site, and only when the user chooses to provide it. We expressly do not request any further personal information of clients and actively discourage users from providing any information which could reasonably be used to identify the user. (For example, it is preferable to provide an anonymous e-mail address that does not easily render you identifiable; \"john.smith@yourworkaddress\" may make it quite easy for us to know who you are, which we do not encourage.) This Site does not use or collect digital cookies to track visitors.&lt;/p&gt; &lt;p&gt;Personal information requested by CAMH and provided by users is held separately and securely by CAMH. We only use personal information provided for the express purpose for which it was collected unless the user specifically agrees to the use of the personal information for additional purposes. In order to prevent unauthorized access and ensure proper use of your personal information, we have developed electronic and administrative procedures to secure information provided by users. In addition, personal information will not be shared with any third party unless required by law.&lt;/p&gt; &lt;p&gt;In the event that CAMH wishes to use aggregate data provided by users for statistical or research purposes, we will do so in a manner that does not reveal to our staff or researchers who you are.&lt;/p&gt; &lt;p&gt;CAMH gathers general trend data concerning traffic on the Site for statistical analysis. We also capture information in the aggregate about how users interact with the Site and what pages they visit. This information is used for auditing and tracking purposes and to improve the content of the Site. The data we collect is used both collectively and individually to create a better experience for the users of this Site. This information is not linked with any individual or IP address.&lt;/p&gt; &lt;p&gt;As a user of the Site who has provided personal information to CAMH, you can have access to your personal information for the purposes of correcting or updating any of your personal information or to delete the personal information you provided on this Site from our records. Registered and signed-in users can click on their nickname at the top of the web page to make changes to their personal information, or personal information can be deleted by &lt;a href=\"/contact\"&gt;contacting the webmaster&lt;/a&gt;.&lt;/p&gt; &lt;/div&gt;','Privacy Policy',0),(5,'Test Invovled','<div class=\"section\" id=\"section-1\"><h2>Get Involved</h2><p>Thought Spot is a crowdsourced map for finding mental health and wellbeing resources in the GTA. It was designed by students, for students. We invite students from all backgrounds and experiences to participate and contribute to the map with their own Thought Spots and help other students.</p></div><div class=\"section\" id=\"section-1a\"><p>This map is for you  so help us make it great! Check out the infographic for ways to get involved.</p><div class=\"infographic-getinvolved infographic\"><img src=\"http://www.mirverburg.net/themes/thought-spot/images/infographics/infographics/getinvolved-v03_01.png\"><a href=\"http://www.mirverburg.net/contact?subject=workshop\"><img src=\"http://www.mirverburg.net/themes/thought-spot/images/infographics/infographics/getinvolved-v03_02.png\"></a><a href=\"http://www.mirverburg.net/contact?subject=suggestion\"><img src=\"http://www.mirverburg.net/themes/thought-spot/images/infographics/infographics/getinvolved-v03_03.png\"></a><a href=\"http://www.mirverburg.net/contact?subject=workshop\"><img src=\"http://www.mirverburg.net/themes/thought-spot/images/infographics/infographics/getinvolved-v03_04.png\"></a><a href=\"https://www.facebook.com/MyThoughtSpot\" target=\"_blank\"><img src=\"http://www.mirverburg.net/themes/thought-spot/images/infographics/infographics/getinvolved-v03_05.png\"></a></div></div><div class=\"section\" id=\"section-2\"><h2>Workshops</h2><p>Workshops are a way for post-secondary students to contribute to and use the Thought Spot map! Workshops can be organized by your student group, class, or residence don. Read on to learn about the different workshops we offer:</p><div class=\"workshop\" id=\"workshop-1\"><h3>Crowdsourcing</h3><p>In this workshop, student participants have the opportunity to explore uploaded resources on the Thought Spot map, update information on an existing spot, add new spots to the map, or provide comments/feedback on resources they have previously used.</p><p>It\'s a fun way to contribute directly to the Thought Spot map as an editor, author, critic (or all three!) while exploring mental health resources in the GTA!</p><p>Please<a href=\"http://www.mirverburg.net/contact\">contact our team</a>for upcoming facilitator or participant opportunities.</p><div class=\"button\"><a href=\"http://www.mirverburg.net/contact\" class=\"button\">Get More Info</a></div></div><div class=\"workshop\" id=\"workshop-2\"><h3>DIY</h3><p>In this workshop, student participants learn about the maps functionalities and link spots with their physical location while touring around a given area. Students have the chance to become better familiarized with a particular neighborhood and the community in which they live.</p><p>DIY Workshops are a fun and engaging way for specific student groups (e.g., international students) to learn about available resources in the community and network with fellow peers.</p><p>Interested in hosting a DIY Workshop? Download our step-by-step guide!</p><div class=\"button\"><a href=\"http://www.mirverburg.net/contact\" class=\"button\">Get Toolkit</a></div></div></div><div class=\"section\" id=\"section-3\"><div class=\"news-feed\" id=\"feed-1\"><h2 title=\"News and Events\">Coming Events</h2></div><div class=\"news-feed\" id=\"feed-2\"><h2 title=\"Twitter\" id=\"section-4\">Twitter Feed</h2><a class=\"twitter-timeline\" href=\"https://twitter.com/mythoughtspot\" data-widget-id=\"503976140818505729\">Tweets by @mythoughtspot</a></div></div>','Test',0);
